import { Button } from "@mui/material";
import { useNavigate } from "react-router";
import logIn from "../../LoginButton";
const Footer = () => {
    return (
      <div
        style={{
          textAlign: "center",
          marginBottom: 10,
        }}
      >
          <Button
            variant="contained"
            color="primary"
            size="large"
            onClick = {logIn}
          >
            Login
          </Button>
      </div>
    );
  };

  export default Footer;
